import Button from '../../common/Button/Button';
import Logo from './components/Logo/Logo';
import './style.scss';

function Header(props) {
	return (
		<div className='wrapper'>
			<div>
				<p>
					<Logo />
				</p>
			</div>
			<ul>
				<li>
                <Button content="Sample Button" variant="green" />
				</li>
				<li>
					<a href='#'>Magesh</a>
				</li>
			</ul>
		</div>
	);
}

export default Header;
